import React from 'react';
import './components.css';

const VideoList: React.FC = () => {
  return (
    <div className="video-list">
      <h3>Featured today</h3>
      <div className="video-thumbnails">
        <img src="path_to_video_thumbnail1.jpg" alt="Thumbnail 1" />
        <img src="path_to_video_thumbnail2.jpg" alt="Thumbnail 2" />
        <img src="path_to_video_thumbnail3.jpg" alt="Thumbnail 3" />
      </div>
    </div>
  );
}

export default VideoList;
